import React from "react";

const LanguageTable = ({ data }) => {
  return (
    <div className="language-table">
      <table>
        <thead>
          <tr>
            <th>순위</th>
            <th>이름</th>
            <th>사용 빈도</th>
            <th>스타 수</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td>{index + 1}</td>
              <td>{item.name}</td>
              <td>{item.usage}</td>
              <td>{item.stars}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default LanguageTable;
